async function Quotes() {

    var cranny;

    var rows = [<div>init</div>];

    var tmp: string = "";


    fetch('https://fakerapi.it/api/v1/persons?_quantity=20', {
        method: 'GET',
        // mode: "no-cors",
    })
        .then(
            res => {
                return res.json();
            }
        )
        .then(
            data => {
                for (var i = 0; i < data.data.length; i++) {
                    tmp += data.data[i].firstname;
                    // console.log(data.data[i].firstname);
                }

                console.log(tmp);

                // processData(data.data);
            }
        )
        .catch(
            (reason) => {
                console.log("Error: \n" + reason);
            }
        )
        .finally(
            () => {
                console.log("this is just a final signal.");
            }
        );


    var testOut = <div>edited quotes ne mi se veruva</div>;

    return <div>{rows}{await tmp}</div>
}

export default Quotes;
